import React from 'react';
import "./Services.css";
import Services1 from "../../../Images/Services/1a.jpg";
import Services2 from "../../../Images/Services/2a.jpg";
import Services3 from "../../../Images/Services/3a.jpg";
import Services4 from "../../../Images/Services/4a.jpg";

const Services = () => {
  return (
    <div className="container gallery">
      <div className="text">
        <h2>We have the best services available for you!</h2>
      </div>
      <div class="row">
      <div class="col-12 col-lg-4 col-md-6">
        <img src={Services1} class="w-100 shadow-1-strong rounded mb-4" height="250" alt="" />
      </div>
      <div class="col-12 col-lg-4 col-md-6">
        <img src={Services2} class="w-100 shadow-1-strong rounded mb-4" height="250" alt="" />
      </div>
      <div class="col-12 col-lg-4 col-md-6">
        <img src={Services3} class="w-100 shadow-1-strong rounded mb-4" height="250" alt="" />
      </div>
      <div class="col-12 col-lg-4 col-md-6">
        <img src={Services4} class="w-100 shadow-1-strong rounded mb-4" height="250" alt="" />
      </div>
    </div>
  </div>
  );
};

export default Services;
